export const getSvg = (name, color) => {
  const svgString = svgs[name];
  const newstr = svgString.replaceAll("customColor", color);
  const encodedSvg = encodeURIComponent(newstr)
    .replace(/'/g, "%27")
    .replace(/"/g, "%22");

  return `data:image/svg+xml,${encodedSvg}`;
};
